"""
Question:
As you might guess, a cafeteria run by mathematicians is a weird place to work. First, you need to figure out when your lunch break is; this is done by typing your ID number into the register.

Because you're in charge of the spoon station, obviously, your ID is based on all the spoons' serial numbers. To figure out your ID, you must check all the serial numbers and multiply the smallest number you find with the biggest. Then divide that by the median value of all the serial numbers.

For some reason, the register only has numbers and no other symbols, so you decide to enter the ID as a rounded-down number.
"""

"""
Input Example
10 9 23 19 74 29 45
"""

"""
Logic Example

Min = 9
Max = 74
Median = 13
Answer = 9 * 74 / 13 = 51.23 = 51
"""


def solution(nums: str) -> int:
    # Get min, max, and median and return the answer
    print("here")
    nums = [int(num) for num in nums.split()]
    smallest = min(nums)
    largest = max(nums)
    print("here")
    median = sorted(nums)[len(nums) // 2]
    print("here")
    return int(smallest * largest / median)


print(solution(strs))
